import React from "react";

const Card = (props) => {
  const { name, email, img } = props;
  return (
    <div className="tc bg-light-green dib br3 pa3 ma2 grow bw2 shaddow-5">
      <img src={img} height="200" width="200" alt="meme1"></img>
      <div>
        <h2>{name}</h2>
        <p>{email}</p>
      </div>
    </div>
  );
};

export default Card;
